Gracias esposa míaaaaaaaaaa!!!!
Es que ella sabe que soy fan de las gomas 😍
@natalysieber

Que cosa eres tú.. 😳🤭 #UnCLasico #tbt 
@aly_sanchezoficial 
@karenmartello 
@natalysieber 
@yoyioficial

Mi cita de hoy es muy especial. 
Ella ha sido tan buena esposa, tan buena con mis hijos, con mi familia y con mis amigos. Por eso la honro con mi amor y entrega. Te amo vida mía . Gracias por ser mi bastón y por nunca decaer pase lo que pase. 
@natalysieber ya tienes cara de mamá 😍

Princesa de nuestras vidas, aquí estás creciendo poco a poco dentro de mi. Tus mamis estamos tan felices de que nos hayas escogido. Eres un sueño hecho realidad. Vienes a complementar y afianzar mucho más nuestro amor de pareja y familia. Tus hermanitos ya quieren jugar contigo. Gracias por permitirme vivir esta etapa tan anhelada. Sentirte crecer dentro de mi ha sido una experiencia maravillosa. Muero de amor con cada patadita 😍. Gracias por regalarnos durante todos estos meses esas pequeñas travesuras a través del eco. Estamos listas para recibirte. Te amamos princesa 🥰 

Aquí parte de una pequeña sesión de fotos que hicimos aunque no soy de fotos pero no podíamos dejar pasar por alto tener plasmado esta etapa tan linda que nos has hecho vivir. 

Un equipo maravilloso que sin duda alguna tuvo el amor, la disposición y la paciencia de fotografiarnos. 

Gracias a todos; 
@karenmartello por siempre convencerme 😍
@juanzabalaph por ese ojo tan maravilloso y hacerme el proceso frente al lente más a gusto. 📸
@luismunozmia por hacer que luzca cómo una top model. 💄
@angito01 por complacerme con las ondas en mi cabello. 💁🏼‍♀️
